full_text:
@DrPaulDWilliams @SellaTheChemist @WanderingGaia @BBCAmos @UniofReading 13 years ago, at a public conference, I asked a member of IPCC WG1, what do we know about the Jet Stream &amp; climate change. She replied, we know very little.
Since then we've learnt a lot, but not enough it seems.
The public then had never heard of the Jet Stream; they have now.

@SkylarkHolly @UniofReading Stay strong.

I was told the same thing when I started at 21 plus "you'll just get pregnant &amp; quit."

Well, the students loved the short, young, practical, pregnant lecturer who 30yrs later has  &gt;100 publications in sheep production &amp; has now returned to her farming roots
